        "product_details": "*** The second official Minecraft tie-in novel, following the Sunday Times bestseller The Island *** This official Minecraft novel is an action-packed thriller! When a new virtual-reality version of the game brings her desires-and doubts-to life, one player must face her fears. Bianca has never been good at following the plan. She's more of an act-now, deal-with-the-consequences-later kind of person. But consequences can't be put off forever, as Bianca learns when she and her best friend, Lonnie, are in a terrible car crash. Waking up in the hospital, almost paralyzed by her injuries, Bianca is faced with questions she's not equipped to answer. She chooses instead to try a new virtual-reality version of Minecraft that responds to her every wish, giving her control over a world at the very moment she thought she'd lost it. As she explores this new realm, she encounters Esme and Anton, two kids who are also playing on the hospital server. The trio teams up to play through to the End, and hopefully to find Lonnie along the way. But the road to recovery isn't without its own dangers. The kids are swarmed by mobs seemingly generated by their fears and insecurities, and now Bianca must deal with the uncertainties that have been plaguing her- Is Lonnie really in the game? And can Bianca help him to return to reality with her? From bestselling author Max Brooks also comes the long-awaited epic conclusion to the Minecraft trilogy, Minecraft- The Village, coming out in October 2023.",
